import pic from '../home_slider.jpg';

class Main extends Component {
    render() {
        return (
            <React.Fragment>
                <div className="container-fluid">
                    <div className="row">
                        <img id="main-pic" src={pic} alt="main-pic"/>
                    </div>
                </div>



            </React.Fragment>
        );
    }
}

export default Main;
